import React from 'react'

function Foot() {
    return (
        <div className='footer'>
            <p>copyright @2021</p>
            <div className='social'>
                <i className='fa fa-facebook'></i>
                <i className='fa fa-instragram'></i>
            </div>
            
        </div>
    )
}

export default Foot
